import React from "react";
import {
  MDBListGroup,
  MDBListGroupItem,
  MDBBtn,
  MDBIcon,
} from "mdb-react-ui-kit";

function ArchiveList(props) {
  const tasks = props.archiveTasks;

  function createTaskList(index, task) {
    return (


            <MDBListGroupItem key={index}>
              {task}
              <MDBBtn
                type="submit"
                className="ms-2 delete-button"
                color="white"
                rounded
              >
                <i class="fas fa-arrow-rotate-left" id="delete-button"></i>
              </MDBBtn>
            </MDBListGroupItem>







    );
  }

  return (
    <div className="h-95 p-5 bg-body-tertiary border rounded-3 mt-2">
        <h3 className="archive-list-title">Archive Lists</h3>
        <p>Good Job!</p>
        <MDBListGroup light small>
  {tasks.map((task, index) => createTaskList(task, index))}
</MDBListGroup>
        </div>
  )


}

export default ArchiveList;
